import styled from "styled-components";


function NavBar () {
    const Name = styled.h2`
        display: flex,
        flex-direction: row
    `
    return (
        <>
            <Name>Rebecca Barrett</Name>
            <a>Projects</a>
            <a>Contact</a>
        </>

    )
}

export default NavBar;
